import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Route} from 'react-router-dom'
import './styles/index.css';
import App from './App';
import * as serviceWorker from './components/serviceWorker';
import Laws from './Laws'

const state = {
    firstCountry: 'Select Country',
    secondCountry: 'Select Country',
}

function countriesSelected(first, second){
    this.setState({
        firstCountry: first,
        secondCountry: second
    })
}

function AppWrapper(){
    return <App {...state} countriesSelected={countriesSelected}/>
}

function LawsWrapper(){
    return <Laws {...state} />
}

function render(){
    ReactDOM.render(
    <BrowserRouter>
        <Route exact path="/" component={AppWrapper} />
        <Route path="/laws" component={LawsWrapper} />
    </BrowserRouter>, 
    document.getElementById('root'));
}
render();
serviceWorker.register();
